import { Component } from "react";
import styles from "./newHeader.css";
import {Link} from "react-router-dom";
import {NEW_HOME_ROUTE} from "../../newConsts";
import logo from "../../../../sourse/images/new_лого.png"

export default class NewHeader extends Component {
    render() {
        const services = [
            'Аренда',
            'Продажа',
            'Новостройки',
            'Дома и участки',
            'Сервисы'
        ]
        const icons = [
            'contrast-outline',
            'chatbubble-ellipses-outline',
            'notifications-outline',
            'business-outline',
        ]
        return (
            <header>
                    <Link to={NEW_HOME_ROUTE}>
                            <img className={styles.newHeader__logo} src={logo} alt={logo}/>
                    </Link>

                    <nav className={styles.newHeader__navigation}>
                        <ul>
                            {
                                services.map(service => {
                                    return (<li className={styles.newHeader__navigationLink}>{service}</li>)
                                })
                            }
                        </ul>
                    </nav>
                        <div className={styles.newHeader__icons}>
                            {
                                icons.map((icon) => {
                                    return(
                                        <Link className={styles.newHeader__iconsItem}>
                                            <ion-icon name={icon} />
                                        </Link>
                                    )
                                })
                            }
                        </div>
                    <button className={styles.newHeader__addAdvert}>+Разместить объявление</button>
                    <div className={styles.newHeader__profileAvatar}></div>
            </header>
        )
    }
}
